import React, { Component } from "react";

class Contact extends Component {
  render() {
    return (
      <div className="contact-body">
        <div class="chip">
          <img src="img_avatar.png" alt="Person" width="96" height="96" />
          John Doe
        </div>
      </div>
    );
  }
}

export default Contact;
